import React from "react";

function Login(){
    return(
        <div className="p-1">
            <h4>Login</h4>
           <p></p> <input
          type="text"
          placeholder="Email"
        />
        <br />
        <input
          type="password"
          placeholder="Password"
        />
        <br />
        <button type="button">
          Login
        </button>            </div>
    );
}

export default Login;
